Características Mouse óptico USB. El mouse óptico USB WEIBO FC143b está dotado con un sensor óptico de avanzada tecnología, el cual ofrece un control de movimiento excepcional y máxima precisión del cursor. Gracias a su diseño ergonómico puedes sostener cómodamente el mouse al coincidir con la configuración natural de ambas manos. El WEIBO FC143b cuenta con la función de detección automática plug&amp; play, y con prácticos conectores que te permite usarlo con un puerto USB.

&nbsp;

COLORES: AZUL, ROJO, NEGRO, BLANCO

Característica:
1. Carcasa de aleación de aluminio, aumenta el área de disipación del calor, facilita la disipación del calor del disco duro en el trabajo, aumenta la vida útil del disco duro;
2. El material es fuerte y resistente al desgaste, mejora la fuerza de amortiguación y evita que el disco duro se caiga y se dañe;
3 el disco de estado sólido M.2 Nvme, que admite el protocolo PCI-E de varias especificaciones, ha mejorado varias veces el rendimiento, lo que puede reducir en gran medida el retraso, reduciendo en gran medida el consumo de energía en el estado de trabajo, Y mejora en gran medida la capacidad de IOPS;
4. Totalmente compatible con la interfaz Nvme M.2 2230 / 2242 / 2260 / 2280 SSD.
5. USB 3,1 Gen2 proporciona hasta 10Gbps de ancho de banda.
6. PCIe GEN3x2 proporciona hasta 16GT/s de ancho de banda.
7. Admite interfaz NVME y conector tipo C.
8. Potente manipulación y recuperación de errores.

*Simbologías: Todos los códigos de barras 1D y 2D estándar

*Tecnología inalámbrica: Bluetooth;

*Distancia de comunicación: 20 mt

*Modo Bluetooth: USB-HID, BLE,  SPP;

*Tiempo de uso esperado: 11 horas  SO: MAC, Linux, Windows;

*Modo de escaneo: Activar escaneo;

*Admite teclados de varios países.

*Alto rendimiento.
